        Intelligence\",\"Topic :: Software Development :: Libraries :: Python Modules\",\"Topic
        :: System :: Logging\",\"Topic :: System :: Monitoring\"],\"description\":\"<div
        align=\\\"center\\\">\\n  <img src=\\\"https://i.imgur.com/RUtiVzH.png\\\"
        width=\\\"600\\\" /><br><br>\\n</div>\\n\\n# Weights and Biases [![PyPI](https://img.shields.io/pypi/v/wandb)](https://pypi.python.org/pypi/wandb)
        [![Conda (channel only)](https://img.shields.io/conda/vn/conda-forge/wandb)](https://anaconda.org/conda-forge/wandb)
        [![CircleCI](https://img.shields.io/circleci/build/github/wandb/wandb/main)](https://circleci.com/gh/wandb/wandb)
        [![Codecov](https://img.shields.io/codecov/c/gh/wandb/wandb)](https://codecov.io/gh/wandb/wandb)\\n\\nUse
        W&B to build better models faster. Track and visualize all the pieces of your
        machine learning pipeline, from datasets to production models.\\n\\n- Quickly
        identify model regressions. Use W&B to visualize results in real time, all
        in a central dashboard.\\n- Focus on the interesting ML. Spend less time manually
        tracking results in spreadsheets and text files.\\n- Capture dataset versions
        with W&B Artifacts to identify how changing data affects your resulting models.\\n-
        Reproduce any model, with saved code, hyperparameters, launch commands, input
        data, and resulting model weights.\\n\\n[Sign up for a free account \u2192](https://wandb.ai/login?signup=true)\\n\\n##
        Features\\n\\n-   Store hyper-parameters used in a training run\\n-   Search,
        compare, and visualize training runs\\n-   Analyze system usage metrics alongside
        runs\\n-   Collaborate with team members\\n-   Replicate historic results\\n-
        \  Run parameter sweeps\\n-   Keep records of experiments available forever\\n\\n[Documentation
        \u2192](https://docs.wandb.com)\\n\\n## Quickstart\\n\\n```shell\\npip install
        wandb\\n```\\n\\nIn your training script:\\n\\n```python\\nimport wandb\\n\\n#
        Your custom arguments defined here\\nargs = ...\\n\\nwandb.init(config=args,
        project=\\\"my-project\\\")\\nwandb.config[\\\"more\\\"] = \\\"custom\\\"\\n\\n\\ndef
        training_loop():\\n    while True:\\n        # Do some machine learning\\n
        \       epoch, loss, val_loss = ...\\n        # Framework agnostic / custom
        metrics\\n        wandb.log({\\\"epoch\\\": epoch, \\\"loss\\\": loss, \\\"val_loss\\\":
        val_loss})\\n```\\n\\nIf you're already using Tensorboard or [TensorboardX](https://github.com/lanpa/tensorboardX),
        you can integrate with one line:\\n\\n```python\\nwandb.init(sync_tensorboard=True)\\n```\\n\\n##
        Running your script\\n\\nRun `wandb login` from your terminal to signup or
        authenticate your machine (we store your api key in ~/.netrc). You can also
        set the `WANDB_API_KEY` environment variable with a key from your [settings](https://app.wandb.ai/settings).\\n\\nRun
        your script with `python my_script.py` and all metadata will be synced to
        the cloud. You will see a url in your terminal logs when your script starts
        and finishes. Data is staged locally in a directory named _wandb_ relative
        to your script. If you want to test your script without syncing to the cloud
        you can set the environment variable `WANDB_MODE=dryrun`.\\n\\nIf you are
        using [docker](https://docker.com) to run your code, we provide a wrapper
        command `wandb docker` that mounts your current directory, sets environment
        variables, and ensures the wandb library is installed. Training your models
        in docker gives you the ability to restore the exact code and environment
        with the `wandb restore` command.\\n\\n## Web Interface\\n\\n[Sign up for
        a free account \u2192](https://wandb.com)\\n[![Watch the video](https://i.imgur.com/PW0Ejlc.png)](https://youtu.be/EeqhOSvNX-A)\\n[Introduction
        video \u2192](https://youtu.be/EeqhOSvNX-A)\\n\\n## Detailed Usage\\n\\nFramework
        specific and detailed usage can be found in our [documentation](http://docs.wandb.com/).\\n\\n##
        Testing\\n\\nTo run basic test use `make test`.  More detailed information
        can be found at CONTRIBUTING.md.\\n\\nWe use [circleci](https://circleci.com)
        for CI.\\n\\n# Academic Researchers\\nIf you'd like a free academic account
        for your research group, [reach out to us \u2192](https://www.wandb.com/academic)\\n\\nWe
        make it easy to cite W&B in your published paper. [Learn more \u2192](https://www.wandb.com/academic)\\n[![](https://i.imgur.com/loKLiez.png)](https://www.wandb.com/academic)\\n\\n##
