        Language :: Python\",\"Topic :: Database :: Front-Ends\",\"Topic :: Office/Business
        :: Financial :: Spreadsheet\",\"Topic :: Scientific/Engineering :: Information
        Analysis\",\"Topic :: Scientific/Engineering :: Visualization\",\"Topic ::
        Software Development :: Libraries :: Application Frameworks\",\"Topic :: Software
        Development :: Widget Sets\"],\"description\":\"# **Weave by Weights & Biases**\\n\\n[![Open
        in Colab](https://colab.research.google.com/assets/colab-badge.svg)](http://wandb.me/weave_colab)\\n[![Stable
        Version](https://img.shields.io/pypi/v/weave?color=green)](https://pypi.org/project/weave)\\n[![Download
        Stats](https://img.shields.io/pypi/dm/weave)](https://pypistats.org/packages/weave)\\n[![Github
        Checks](https://img.shields.io/github/check-runs/wandb/weave/master\\n)](https://github.com/wandb/weave)\\n\\nWeave
        is a toolkit for developing Generative AI applications, built by [Weights
        & Biases](https://wandb.ai/).\\n\\n---\\n\\nYou can use Weave to:\\n\\n- Log
        and debug language model inputs, outputs, and traces\\n- Build rigorous, apples-to-apples
        evaluations for language model use cases\\n- Organize all the information
        generated across the LLM workflow, from experimentation to evaluations to
        production\\n\\nOur goal is to bring rigor, best-practices, and composability
        to the inherently experimental process of developing Generative AI software,
        without introducing cognitive overhead.\\n\\n<div align=\\\"center\\\">\\n
        \ <img src=\\\"https://raw.githubusercontent.com/wandb/weave/master/docs/static/weave-ui-example.jpg\\\"
        width=\\\"100%\\\">\\n</div>\\n\\n## Documentation\\n\\nOur documentation
        site can be found [here](https://wandb.me/weave)\\n\\n## Installation\\n```\\npip
        install weave\\n```\\n\\n## Usage\\n\\n### Tracing\\nYou can trace any function
        using `weave.op()` - from api calls to OpenAI, Anthropic, Google AI Studio
        etc to generation calls from Hugging Face and other open source models to
        any other validation functions or data transformations in your code you'd
        like to keep track of.\\n\\nDecorate all the functions you want to trace,
        this will generate a trace tree of the inputs and outputs of all your functions:\\n\\n```python\\nimport
        weave\\nweave.init(\\\"weave-example\\\")\\n\\n@weave.op()\\ndef sum_nine(value_one:
        int):\\n    return value_one + 9\\n\\n@weave.op()\\ndef multiply_two(value_two:
        int):\\n    return value_two * 2\\n\\n@weave.op()\\ndef main():\\n    output
        = sum_nine(3)\\n    final_output = multiply_two(output)\\n    return final_output\\n\\nmain()\\n```\\n\\n###
        Fuller Example \\n\\n```python\\nimport weave\\nimport json\\nfrom openai
        import OpenAI\\n\\n@weave.op()\\ndef extract_fruit(sentence: str) -> dict:\\n
        \   client = OpenAI()\\n\\n    response = client.chat.completions.create(\\n
        \   model=\\\"gpt-3.5-turbo-1106\\\",\\n    messages=[\\n        {\\n            \\\"role\\\":
        \\\"system\\\",\\n            \\\"content\\\": \\\"You will be provided with
        unstructured data, and your task is to parse it one JSON dictionary with fruit,
        color and flavor as keys.\\\"\\n        },\\n        {\\n            \\\"role\\\":
        \\\"user\\\",\\n            \\\"content\\\": sentence\\n        }\\n        ],\\n
        \       temperature=0.7,\\n        response_format={ \\\"type\\\": \\\"json_object\\\"
        }\\n    )\\n    extracted = response.choices[0].message.content\\n    return
        json.loads(extracted)\\n\\nweave.init('intro-example')\\n\\nsentence = \\\"There
        are many fruits that were found on the recently discovered planet Goocrux.
        There are neoskizzles that grow there, which are purple and taste like candy.\\\"\\n\\nextract_fruit(sentence)\\n```\\n\\n\\n##
        Contributing\\n\\nInterested in pulling back the hood or contributing? Awesome,
        before you dive in, here's what you need to know.\\n\\nWe're in the process
        of \U0001F9F9 cleaning up \U0001F9F9. This codebase contains a large amount
        code for the \\\"Weave engine\\\" and \\\"Weave boards\\\", which we've put
        on pause as we focus on Tracing and Evaluations.\\n\\nThe Weave Tracing code
        is mostly in: `weave/trace` and `weave/trace_server`.\\n\\nThe Weave Evaluations
        code is mostly in `weave/flow`.\\n\",\"description_content_type\":\"text/markdown\",\"docs_url\":null,\"download_url\":null,\"downloads\":{\"last_day\":-1,\"last_month\":-1,\"last_week\":-1},\"dynamic\":null,\"home_page\":null,\"keywords\":null,\"license\":\"Apache-2.0\",\"maintainer\":null,\"maintainer_email\":\"W&B
